measurements.description:
Eleven flowers on one upright inflorescence;  
   sepals and petals slightly cupped, cream, striped and overlaid pink-rose;

  lip cream, side lobes speckled pink rose upper edge, midlobe spotted and edged maroon, keels yellow, speckled maroon;
	column dark maroon, anther cap cream, lightly speckled maroon;   

	substance firm; texture matte.
